import React, { Component } from 'react'

class DateComponent extends Component {
    constructor() {
        super();

        var today = new Date(),
            date = today.getDate(),
            month = today.getMonth()+1,
            year = today.getFullYear();

        this.state = {
            date: date,
            month: month,
            year: year
        };
    }

    monthNames = () => {
        switch(this.state.month) {
          case '1':
            return 'January';
          case '2':
            return 'February';
          case '3':
            return 'March';       
          default:
            return 'foo';
        }
    }  


    render() {
        return (
            <div>
                {this.state.date}+' '{this.monthNames()}
            </div>
        )
    }
}

export default DateComponent
